        "id": 843162693,
        "title": "Minecraft-ish MMO v1.7",
        "description": "",
        "instructions": "⭐⭐⭐⭐ Coding Tutorials here ⭐⭐⭐⭐\n⭐⭐⭐ www.youtube.com/griffpatch ⭐⭐⭐\n\nMMO Tutorial - https://youtu.be/1JTgg4WVAX8\n\n⭐ Fixed Furnaces - Sorry!!!\n⭐ Place your Land Claim Sign to protect your building \n⭐ Escape Land Claim TRAPS by holding the \"U\" key\n\nThe other players are 100% real, but we'll need to wait for the initial interest to dwindle before the game becomes very playable again lol - A good number of people is 20-30, but we have 100+ - It will lag and the world will be eaten up :D\n\nThis project is a test for whether a Massive Multiplayer Online Sandbox world is possible in Scratch - If things go well, then I may migrate this to my main account.\n\nYou will notice the level takes a while to show all players 'edits'. This is normal as the game catches up over the first few minutes of play. The longer people have been playing, the longer it can take to see their changes! That's the deal I'm afraid :)\n\nControls:\n[Cursor Keys / WASD] to move\n[Click] to mine / place\n[1..9] Switch Hotbar for placement\n[R / Green Flag] Respawn / Keep Items\n[U] Enable fly mode when stuck in Land Claims\n[N] Show player slots\n[T] to Talk (or C for chat... whatever!)\n[F] Eat food\n[Space] over a tile to see who changed it\nStand next to a crafting table to craft more items\n\n⭐ Change Log\n11 Sept 2023 v1.7 - Fixed Furnaces! oops\n13 May 2023 v1.6 - Pig Mask Experiment!\n10 May 2023 v1.5 - Farming Wheat (use hoe on ground, mine grass for seeds, plant seeds, wait! or use bone meal to speed it up) + Added barrels & bookcase\n10 May 2023 v1.4b - Bugfix - Digging an unclaimed sign no longer removes your own land claim\n9 May 2023 v1.4 - Press U to enable fly mode | stack limit upped to 32 | Crafting now warns of too many items\n3 May 2023 v1.3 - Hold U to escape land claim trap, can't place on self, and other players move out of the way, claiming land prevents blocks disappearing when other players leave.\n1 May 2023 v1.2 - Land Claim Signs... Gulp\n30 Apr 2023 v1.1 - Let's see what it's like with light?\n29 Apr 2023 v1.0 - Brought over to my main account\n29 Apr 2023 v0.17 - Woods, Stairs, Fences, Changes to digging / placing 'through' solid objects\n20 Apr 2023 v0.16 - New items, reload tweak\n19 Apr 2023 v0.15 - New cloud system (stability improvements)\n19 Apr 2023 v0.14 - Chat + Drag to rearrange hotbar\n18 Apr 2023 v0.13b - Cloud Bug Fixes\n18 Apr 2023 v0.13 - Big changes to allow armour\n15 Apr 2023 v0.12 - Saplings grow, Furnace can be lit and used\n14 Apr 2023 v0.11 - More items :)\n14 Apr 2023 v0.10 - Prevent crafting of invalid blocks\n13 Apr 2023 v0.9 - Testing out stacks... may be bugs?\n12 Apr 2023 v0.8 - Beds place better / Space to see who placed a block\n11 Apr 2023 v0.7 - Initial Crafting Concept...\n8 Apr 2023 v0.6 - More blocks / Wood -> Planks\n8 Apr 2023 v0.5 - Added Basic Inventory Bar\n7 Apr 2023 v0.4 - Implemented Ladders\n7 Apr 2023 v0.3 - Increased world size x5\n6 Apr 2023 v0.2 - Added Block Meta / Platforms\n5 Apr 2023 v0.1 - Initial Release",
