        "description": "FULL 100 ACHIEVEMENT WALKTHROUGH VIDEO\n▶️ https://www.youtube.com/watch?v=BdLuXvsJTfs\n▶️ MMO Tutorial - https://youtu.be/1JTgg4WVAX8\n\nServer 1 - https://scratch.mit.edu/projects/12785898/\nServer 2 - https://scratch.mit.edu/projects/378507713/\nServer 3 - https://scratch.mit.edu/projects/823872487/\n\n★★★★ Controls ★★★★\n[Cursor keys] - To Move and Jump\n[Space] - Use special ability (if you have one)\n[T] - Safe Chat   [X] - Discard power up\n[R] - Respawn   [A] - Achievement list\n[N] - Toggle Names\n\nClick the Hat Icon (top right) to change hats (once you earn some)\n\n★★★★ Info ★★★★\nOther players can hop in and out of the game so if you don't see anyone you just need to wait for someone else to join at the same time.  If you are a 'new scratcher' then I'm really sorry to tell you this won't work for you yet (you need to graduate to Scratcher status!)\n\nTip for wall jumping - To wall jump, simply hold up to jump, touch a wall and then pull away STILL HOLDING THE UP KEY :) - Never let it go while wall jumping, that's the secret!!!\n\n★★★★ Change Log ★★★★\n25 Mar 2023 - 100 Achievements!!!\n22 Mar 2023 - Updated Lag & Turbo Mode Smoother\n21 Mar 2023 - Added Minions!\n20 Mar 2023 - Hats awarded for achievements\n19 Mar 2023 - Improved Water, Removed stair trap\n03 Feb 2020 - Added Snail, Pony-Kat-Chu \n13 Feb 2020 - TRex can now eat you!\n06 Feb 2020 - Very hard Pikachu Speedrun\n04 Feb 2020 - Added Pikachu\n04 Feb 2020 - Rainbow Toad (+ Accidental green flag doesn't reset achievements)\n03 Feb 2020 - Reduced footprint of cloud data + added rainbow effect to completion of snail, caterpillar & flappy bird games.\n01 Feb 2020 - Added Snail + Snail Mini-game\n29 Jan 2020 - Added Toad + mini toad\n27 Jan 2020 - Added T-Rex :)\n24 Jan 2020 - Added support for 8 players\n21 Jan 2020 - Fixed for Scratch 3 - Achievements and High Score no longer are stored sorry\n08 Oct 2017 - Improved flappy bird\n24 Feb 2016 - Yep... You can proper safe chat now!\n23 Feb 2016 - Performance + Changes to tractor beam\n21 Feb 2016 - Touching sprite + new powerup station & minigame! Tractor beam massively improved!\n18 Feb 2016 - 12 new achievements\n30 Sep 2013 - Initial Release",
