        "instructions": "———— [ Another Ball Physics Experiment ] ————\nTutorials on YouTube: www.youtube.com/griffpatch\n\nYep, I've done ball physics before - But gosh, it keeps me coming back! Somehow trying to bring together sprite collisions AND physics math is just very tricksome lol. What's new here is that I am also including angular velocity (that is rotation & friction).\n\nTo make it more entertaining I've added a coin counter and timer.\n\n—— Controls ——\nRotate Left / Right - [Arrow Keys] Or [Touch]\nReset [R]\n\n—— What...? ——\nRead this far? - Would you like me to explain the workings a little in a video?\n\n—— Change Log ——\n19 Jan 2023 - Added Scrolling - And why not!\n19 Jan 2023 - Added R for reset\n19 Jan 2023 - Fixed contact sound bug,\n18 Jan 2023 - Initial Release",
