        "id": 702543294,
        "title": "slither.io v1.13 (#3)",
        "description": "",
        "instructions": "★★★ YouTube Tutorials ★★★\nwww.youtube.com/griffpatch/\n\nServer 1 - https://scratch.mit.edu/projects/108566337/\nServer 2 - https://scratch.mit.edu/projects/544213416/\n\n■ Stable 10 players - Improved Joining script\n■ 25 snake presents + custom skins\n■ Better multiplayer forward prediction\n■ Less lag for large snakes\n\n★★★ Slither.io Scratch Edition ★★★\nThis is my best attempt at a Multiplayer slither.io game. You can only be killed by the snakes as 'you' see them, but be aware that due to network lag other snakes may appear to not be killed by you because on their screens they may be just a little ahead of where you see them.\n\n★ Control your snake with the mouse.\n★ Collect the food to grow longer.\n★ Don't run into other snakes!\n★ Click or Space to dash (if you have eaten enough)\n\nPress 'L' to toggle lag mode (turns off all the effects)\nPress 'N' to toggle player names (helps reduce lag too)\n\n★★★ Credit ★★★\nAll credit to slither.io for the original game...  Also credit to @theChAOTiC for the basis of the font engine that I remixed.\n\n★★★ Change Log ★★★\n10 Jun 2022 - v1.13 - Enhanced game joining code | 5 new snake skins | Improved text rendering\n8 Jun 2022 - v1.12 - Increased Max Players to 10 | Chose better starting snake skins | Improved forward prediction of snakes | Reduced lag caused by large snakes | layered map on top of snakes | removed Herobrine\n7 Jun 2022 - v1.11 - Made invulnerable snakes be non-deadly for slightly longer than they are invulnerable to stop little snakes taking advantage\n14 Jun 2021 - Server 2\n23 Jun 2019 - Reshared with the release of my YouTube Series on Cloud Games!\n8 Jan 2019 - v1.10 - Experimental Improvements in face of unpredictable cloud data...\n24 Jun 2019 - reshared for screen cast\n3 Jan 2019 - v1.9 - Fixed for Scratch 3 Pen.\n22 Sep 2017 - v1.8 - Throttled Cloud Data send rate to try to get this working within the new cloud data limits.\n6 May 2016 - v0.1 - Initial Release",
