        "instructions": "★ This project is based on my YouTube Video ★★\n★★★ ULTRA FAST SCANNING TUTORIAL ★★★\n★★★★★ https://youtu.be/3lz1nylUHiY ★★★★★★\n\nOriginally designed to scan textures for my raycaster, I quickly began to realise the fun we could have with this when combined with the camera sensing block.\n\nThe thumbnail shows me waving my arms as the scan progresses down the screen but with the rest of my body kept still - It's like a slow progressive exposure :) Awesome!\n\nSpecial Notice - This project does not make use of cloud data, so you can be quite sure it is not sharing your image in any way. If you are ever unsure then just look below the project on this screen and look if it says \"Cloud Variables\" next to \"Video Sensing\". If not, then you are quite safe! If it does, then please be careful!\n\nCredit to @Geotale for pioneering the new binary partitioned scanning technique",
