        "title": "Tile Scrolling | ep17 | Koopa & Shells",
        "description": "★  Complete Tile Scrolling Episode 16 Scripts   ★\n★ Now Follow Tutorial Episode 17 to add Koopas! ★\n★      https://youtu.be/UsBFARVXOIM      ★\n\nThis is a work in progress SMB Advance 4 engine that we are building as part of an ongoing YouTube series.\n\nTo learn how all this was made you can follow the full YouTube series (https://youtu.be/Fl-LX94Z4Cc). However, due to popular request, here are the completed scripts for episode 16 - No excuse now not to try to add Koopas by following episode 17:\n\nhttps://youtu.be/UsBFARVXOIM\n\n★ Controls\nCursor keys / WASD to move\n\n★ Level Editor Keys\n0 (zero) to toggle level editor\n1-5 to switch tiles, E to pick tile under cursor\n9 to place enemies\nQ to Toggle auto tile arranging\nR to Reset the level\nL to Switch Levels (See levels 1-3)\n\n★ Special Note on Saving Levels\nTo save your level updates, you must exit the level editor with the 0 key again, and then look inside the project and go File / Save. This ensures your level is saved along with your scratch project!\n\n★ This is not a complete game by any means! You can learn from it, and we will continue to build it out in future episodes on YouTube!\n\n★ All sprites are from Nintendo's Super Mario Adv 4\nhttps://scratch.mit.edu/projects/485855713/\n\n★ Many more fun tutorials can be found on my channel! Enjoy - https://www.youtube.com/griffpatch",
