        "title": "E.T. End Credits | Piano Music | v1.0",
        "description": "Coding Tutorials on my Griffpatch YouTube Channel :)\n\n****** E.T. END CREDITS PIANO PLAYER ******\n\nI really loved this piece of piano piece from when I first heard it as a child - It's the end credits from E.T. I'd love to be able to play it on the piano myself, but not being good enough I instead transcribed the sheet music into this new Scratch Project.\n\nThe built in Scratch piano didn't quite sound good enough, so I've imported the samples from a free piano virtual instrument (The SGPN sound-font). This involved mapping each of the 20 sound samples onto a selection of 3 to 5 possible piano notes. The results are pretty good :)\n\nThe treble clef and bass clefs each have their notes encoded in a list on their respective sprites. I typed them in my hand reading from the piano score, and they are in the format:\n\nC#4^12 - This means Play a C# in octave 4 with an accent (loud) for one 4th of a bar (48 is a full bar). I used 12 because then I can do triplets easier - Enjoy! This song is full of them.\n",
